import React from 'react'

class Quotes extends React.Component{
    render(){
        return(
            <div className="quotes">
                Kami adalah anda<br/>
                Anda yang kreatif dan produktif<br/>
                Kita adalah Cazam
            </div>
        )
    }
}

export default Quotes
